        text : 'تعتمد خدماتنا المصرفية على بروتوكولات أمان متقدمة للحفاظ على سرية حساباتكم'
    },
    {
        url : require('../Assets/images/08.jpg'),
        text : 'خدماتنا المصرفية تشمل تحقق الهوية للعملاء وإجراءات التحقق بمعلومات الحساب المحددة لتفادي الاحتيال'
    },
    {
        url : require('../Assets/images/09.jpg'),
        text : 'يمكنكم الاعتماد على خدماتنا المصرفية لإدارة أموالكم بأمان وثقة'
    }
 ];
